var safeHtml = function(unsafeHtml) {
    if (unsafeHtml) {
        return unsafeHtml
            .replace(/&/g, '&amp;')
            .replace(/</g, '&lt;')
            .replace(/>/g, '&gt;')
            .replace(/"/g, '&quot;') 
            .replace(/\//g, '&#x2F;')
            .replace(/\(/g, '&lpar;')
            .replace(/\)/g, '&rpar;');
    }
    return '';
};
